import React from 'react';
import './App.css';
import {BrowserRouter, Navigate, Route, Routes} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div>
        <Routes>
          <Route path={'/hello'} element={<HelloPage />}/>
            <Route path="/*" element={<Navigate to="/hello" replace />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
